All Atlantic Bluefin tuna (Thunnus thynnus) is wholly obtained;

or
Production in which Atlantic Bluefin tuna (Thunnus thynnus) is subject to caging in farms with subsequent feeding and fattening or farming for a minimum period of three months in a Party. The duration of the fattening or farming shall be established according to the date of the caging operation and the date of harvesting recorded in the electronic Bluefin tuna Catch Document (eBCD) of the International Commission for the Conservation of Atlantic Tunas (IChange of chapter - CCAT).{{CC}}{{WO}}

